import Chat_element from "./chat_element";
import {Link} from "react-router-dom";
import React, {useState} from "react";

function Dialog(props) {
    let user = props.location.state.user;
    return (
        <table>
            <tbody>
            <tr>
                <td>{useState()}</td>
                <td>{user.surname}</td>
                <td>{user.name}</td>
                <td>{user.patronymic}</td>
            </tr>
            </tbody>
        </table>
    )
}

export default Dialog;
